    addToCart(product) {
        if (product.quantity) {
            product.quantity = product.quantity + 1;
            product.total_amount = product.sale_price * product.quantity;
        }
        else {
            product.quantity = 1;
            product.total_amount = product.sale_price * product.quantity;
            this.cartService.addToCart(product);
        }
    }
